import { Component } from "react";

class User extends Component {
    constructor(props){
        super(props);
        this.state={
            name:this.name,
            age:10 
        }
    }
    render() {
        return (
            <div>
            <h1>My name is  {this.state.name}. My age is {this.state.age}.</h1>
            <img src={this.props.image} width={100} height={150} 
            alt="Image not found"/>
            </div>
        )
    }
}

export default User;
